INSERT INTO `online_blogs` VALUES (1,'使用Telnet时通过SMTP直接收发邮件','','','','2015-03-26','佳华',0,'telnet smtp.scut.edu.cn 25<br>\r\n220 scut.edu.cn ESMTP Sendmail 8.12.8/8.12.8; Tue, 13 Sep 2005 15:02:33 +0800<br>\r\nhelo tt<br>\r\n250 scut.edu.cn Hello [202.**.***.**], pleased to meet you<br>\r\nmail from:<tan**@scut.edu.cn><br>\r\n250 2.1.0 <tan**@scut.edu.cn>... Sender ok<br>\r\nrcpt to:<tan**@scut.edu.cn><br>\r\n250 2.1.5 <tan**@scut.edu.cn>... Recipient ok<br>\r\ndata<br>\r\n354 Enter mail, end with \".\" on a line by itself<br>\r\nfrom:<tan##@sina.com><br>\r\nto:<tan**@scut.edu.cn><br>\r\nsubject:test<br>\r\njust for test<br>\r\n.    ------加点确认<br>','linux'),(2,'令他人ping本地不响应','','','','2015-03-26','佳华',0,'可以用： <br>\r\n#echo ;1 ;> ;/proc/sys/net/ipv4/icmp_echo_igore_all ;<br>\r\n想恢复的时候用： ;<br>\r\n#echo ;0 ;> ;/proc/sys/net/ipv4/icmp_echo_igore_all<br>','linux'),(3,'Linux下编译核心（以centos，编译ntfs模块为例）','','','','2015-03-27','佳华',0,'编译centos内核的过程<br>\r\n到http://www.kernel.org寻找合适的linux kernel src package<br>\r\n下载 linux-2.6.18.8.tar.gz<br>\r\ncd /usr/src<br>\r\ntar -xvzf linux-2.6.18.8.tar.gz<br>\r\nln -s linux-2.6.18.8 linux<br>\r\ncd linux<br>\r\ncp /boot/config-2.6.18-8.1.8.el5 /usr/src/linux/.config  //这一步的目的是使用CENTOS为我们准备好的配置文件，里面有些优化信息，来源：很多编译kernel的文章都提到这一点<br>\r\nmake menuconfig<br>\r\n选择合适的组件<br>\r\nmake clean<br>\r\nmake mrproper<br>\r\nmake <br>\r\nmake modules<br>\r\nmake modules_install<br>\r\nmake bzImage<br>\r\nreboot<br>','linux'),(4,'Python 聊天室','','','','2015-04-01','Jerry',0,'<html>\r\n<head>\r\n<title>1.py</title>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=GBK\">\r\n<style type=\"text/css\">\r\n<!--.line_num {color: #666666; background-color: #E8E8E8;}//-->\r\n</style>\r\n</head>\r\n<body bgcolor=#FFFFFF text=#000000>\r\n<pre style=\"font: 9pt Verdana, Fixedsys, Verdana, Tahoma;\">\r\n<span class=line_num>        =====文件名：1.py=====</span>\r\n<font color=#008000>#!/usr/bin/python</font>\r\n<font color=#0000FF>import</font> socket\r\n<font color=#0000FF>import</font> select\r\n\r\n<font color=#0000FF>class</font> ChatServer:\r\n\r\n     <font color=#0000FF>def</font> __init__(self, port):\r\n          self.port = port\r\n              self.srvsock = socket.socket( socket.AF_INET, socket.SOCK_STREAM )\r\n              self.srvsock.setsockopt( socket.SOL_SOCKET, socket.SO_REUSEADDR, 1 )\r\n              self.srvsock.bind( (<font color=#FF00FF>\"172.16.1.136\"</font>, port) )\r\n              self.srvsock.listen( 5 )\r\n\r\n              self.descriptors = [self.srvsock]\r\n              <font color=#0000FF>print</font> <font color=#FF00FF>\'ChatServer started on port &#37;s\'</font> % port\r\n\r\n     <font color=#0000FF>def</font> run(self):\r\n          <font color=#0000FF>while</font> 1:\r\n               sread, swrite, sexc = select.select( self.descriptors, [], [] )\r\n\r\n               <font color=#0000FF>for</font> sock <font color=#0000FF>in</font> sread:\r\n                    <font color=#0000FF>if</font> sock == self.srvsock:\r\n                            self.accept_new_connection()\r\n                          <font color=#0000FF>else</font>:\r\n                         str = sock.recv(100)\r\n\r\n                         <font color=#0000FF>if</font> str == <font color=#FF00FF>\'\'</font>:\r\n                              host,port = sock.getpeername()\r\n                                   str = <font color=#FF00FF>\'Client left &#37;s&#58;&#37;s&#92;r&#92;n\'</font> % (host, port)\r\n                                   self.broadcast_string( str, sock )\r\n                                   sock.close\r\n                                   self.descriptors.remove(sock)\r\n                         <font color=#0000FF>else</font>:\r\n                                   host,port = sock.getpeername()\r\n                                   newstr = <font color=#FF00FF>\'&#91;&#37;s&#58;&#37;s&#93; &#37;s\'</font> % (host, port, str)\r\n                                   self.broadcast_string( newstr, sock )\r\n\r\n     <font color=#0000FF>def</font> accept_new_connection( self ):\r\n          newsock, (remhost, remport) = self.srvsock.accept()\r\n            self.descriptors.append( newsock )\r\n\r\n            newsock.send(<font color=#FF00FF>\"You&#39;re connected to the Python chatserver&#92;r&#92;n\"</font>)\r\n            str = <font color=#FF00FF>\'Client joined &#37;s&#58;&#37;s&#92;r&#92;n\'</font> % (remhost, remport)\r\n            self.broadcast_string( str, newsock )\r\n\r\n     <font color=#0000FF>def</font> broadcast_string( self, str, omit_sock ):\r\n\r\n            <font color=#0000FF>for</font> sock <font color=#0000FF>in</font> self.descriptors:\r\n                   <font color=#0000FF>if</font> sock != self.srvsock <font color=#0000FF>and</font> sock != omit_sock:\r\n                          sock.send(str)\r\n\r\n\r\n            <font color=#0000FF>print</font> str,\r\n\r\nmyServer = ChatServer( 2626 ).run()\r\n</pre>\r\n</body>\r\n</html>\r\n','python'),(5,'https登陆获取登陆页面','','','','2015-04-01','Jerry',0,'因项目需要，页面必须要登陆后才能触发后台的一个功能，没办法每天人工登陆，所以写了这个<br>\r\n<html>\r\n<head>\r\n<title>httpsLogin.py</title>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=GBK\">\r\n<style type=\"text/css\">\r\n<!--.line_num {color: #666666; background-color: #E8E8E8;}//-->\r\n</style>\r\n</head>\r\n<body bgcolor=#FFFFFF text=#000000>\r\n<pre style=\"font: 9pt Verdana, Fixedsys, Verdana, Tahoma;\">\r\n<span class=line_num>        =====文件名：httpsLogin.py=====</span>\r\n__author__ = <font color=#FF00FF>\'jerry&#46;liu\'</font>\r\n<font color=#008000>#coding:utf8</font>\r\n<font color=#0000FF>import</font> sys, httplib\r\n<font color=#0000FF>import</font> urllib\r\n<font color=#0000FF>import</font> urllib2\r\npara = {<font color=#FF00FF>\'email\'</font>: <font color=#FF00FF>\'superadmin&#64;goldpay&#46;com\'</font>,  <font color=#FF00FF>\'password\'</font>: <font color=#FF00FF>\'123456\'</font>}\r\ndata = urllib.urlencode(para)\r\nheaders = {<font color=#FF00FF>\"Content-type\"</font>: <font color=#FF00FF>\"application/x-www-form-urlencoded\"</font>}\r\n<font color=#0000FF>print</font> data\r\nhttplib.HTTPSConnection.debuglevel = 1\r\ncon2 = httplib.HTTPSConnection(<font color=#FF00FF>\'crm&#46;goldpay&#46;com\'</font>)\r\ncon2.request(<font color=#FF00FF>\"POST\"</font>, <font color=#FF00FF>\"/goldqcrm/dologin.do\"</font>, data, headers)\r\n\r\nr2 = con2.getresponse()\r\nnewUrl = r2.getheader(<font color=#FF00FF>\'location\'</font>) #这里是因为页面被重定向了，需要从返回的http头<br>#里拿出重定向的链接,没有的话可以直接跳过这一步直接 urlopen\r\na = newUrl.replace(<font color=#FF00FF>\'main&#46;do\'</font>, <font color=#FF00FF>\'main&#47;index&#46;do\'</font>)\r\nf = urllib2.urlopen(newUrl, timeout=5).read()\r\n<font color=#0000FF>print</font> f\r\n<font color=#0000FF>if</font> r2.status == 200:\r\n    <font color=#0000FF>print</font> r2.read()\r\n    <font color=#0000FF>print</font> <font color=#FF00FF>\"Success\"</font>, <font color=#FF00FF>\"\\n\"</font>\r\n<font color=#0000FF>else</font>:\r\n    <font color=#0000FF>print</font> r2.status\r\n    <font color=#0000FF>print</font> <font color=#FF00FF>\"Failed\"</font>, <font color=#FF00FF>\"\\n\"</font>\r\ncon2.close()\r\n</pre>\r\n</body>\r\n</html>\r\n','python'),(6,'备份数据库脚本','','','','2015-04-01','',0,'也就是免去每次都要打命令的麻烦，其他没什么<br>\r\nbakPath和配置文件按需求更改<br><br>\r\n<html>\r\n<head>\r\n<title>DumpAndRestoreDB.py</title>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=GBK\">\r\n<style type=\"text/css\">\r\n<!--.line_num {color: #666666; background-color: #E8E8E8;}//-->\r\n</style>\r\n</head>\r\n<body bgcolor=#FFFFFF text=#000000>\r\n<pre style=\"font: 9pt Verdana, Fixedsys, Verdana, Tahoma;\">\r\n<span class=line_num>        =====文件名：DumpAndRestoreDB.py=====</span>\r\n<font color=#008000>#!/usr/bin/python</font>\r\n__author__ = <font color=#FF00FF>\'jerry&#46;liu\'</font>\r\n<font color=#0000FF>import</font> datetime\r\n<font color=#0000FF>import</font> ConfigParser\r\n<font color=#0000FF>import</font> os\r\n\r\nbakPath = <font color=#FF00FF>\"/home/aspect/tools/bak\"</font>\r\n\r\n<font color=#0000FF>def</font> dumpRestoreDB(section, act):\r\n    <font color=#0000FF>global</font> dbHost, dbUser, dbPass, dbName, config\r\n    dbHost = config.get(section, <font color=#FF00FF>\'dbHost\'</font>)\r\n    dbUser = config.get(section, <font color=#FF00FF>\'dbUser\'</font>)\r\n    dbPass = config.get(section, <font color=#FF00FF>\'dbPass\'</font>)\r\n    dbNameAll = config.get(section, <font color=#FF00FF>\'dbName\'</font>)\r\n    dbNameList = dbNameAll.split(<font color=#FF00FF>\'&#59;\'</font>)\r\n    <font color=#0000FF>print</font> <font color=#FF00FF>\"Which database do you want to %s?\"</font> % act\r\n    <font color=#0000FF>for</font> i <font color=#0000FF>in</font> range(len(dbNameList)):\r\n        <font color=#0000FF>print</font> <font color=#FF00FF>\"%s:%s\"</font> % (i+1, dbNameList[int(i)])\r\n    key = raw_input(<font color=#FF00FF>\"\"</font>)\r\n    dbName = dbNameList[int(key)-1]\r\n    <font color=#0000FF>if</font> act == <font color=#FF00FF>\'dump\'</font>:\r\n        now = datetime.datetime.now().strftime(<font color=#FF00FF>\'&#37;Y&#45;&#37;m&#45;&#37;d&#45;&#37;H&#45;&#37;M&#45;&#37;S\'</font>)\r\n        dumpFileName = <font color=#FF00FF>\'&#37;s&#45;&#37;s&#45;&#37;s&#46;sql\'</font> % (section, dbName, now)\r\n        <font color=#0000FF>print</font> <font color=#FF00FF>\'Dumping&#44; please wait&#46;&#46;&#46;&#46;\'</font>\r\n        os.popen(<font color=#FF00FF>\"/usr/bin/mysqldump -h%s -u%s -p%s %s &gt; %s/%s\"</font> % (dbHost, dbUser, dbPass, dbName, bakPath, dumpFileName))\r\n        <font color=#0000FF>print</font> <font color=#FF00FF>\'DB dumped as  &#37;s&#47;&#37;s\'</font> % (bakPath, dumpFileName)\r\n    <font color=#0000FF>if</font> act == <font color=#FF00FF>\'restore\'</font>:\r\n        restoreFileHash = {}\r\n        <font color=#0000FF>print</font> <font color=#FF00FF>\'Please select sqlfile to restore&#46;\'</font>\r\n        <font color=#0000FF>for</font> j <font color=#0000FF>in</font> range(len(os.listdir(bakPath))):\r\n            <font color=#0000FF>print</font> <font color=#FF00FF>\'&#37;s&#58;&#37;s\'</font> % (j+1, os.listdir(bakPath)[j])\r\n            restoreFileHash[j+1] = <font color=#FF00FF>\'&#37;s&#47;&#37;s\'</font> % (bakPath, os.listdir(bakPath)[j])\r\n        thisKey = raw_input(<font color=#FF00FF>\"\"</font>)\r\n        restoreFile = restoreFileHash[int(thisKey)]\r\n        <font color=#0000FF>print</font> <font color=#FF00FF>\'Now begin to restore &#37;s\'</font> % restoreFile\r\n        os.popen(<font color=#FF00FF>\"/usr/bin/mysql -h%s -u%s -p%s %s &lt; %s\"</font> % (dbHost, dbUser, dbPass, dbName, restoreFile))\r\n\r\n<font color=#0000FF>if</font> __name__ == <font color=#FF00FF>\'&#95;&#95;main&#95;&#95;\'</font>:\r\n    config = ConfigParser.ConfigParser()\r\n    config.readfp(open(<font color=#FF00FF>\'&#47;home&#47;aspect&#47;tools&#47;conf&#47;dumpAndRestoreDB&#46;ini\'</font>,<font color=#FF00FF>\'rb\'</font>))\r\n    <font color=#0000FF>print</font> <font color=#FF00FF>\'What action do you want to do with DB&#63;\'</font>\r\n    <font color=#0000FF>print</font> <font color=#FF00FF>\'1&#58;dump\'</font>\r\n    <font color=#0000FF>print</font> <font color=#FF00FF>\'2&#58;restore\'</font>\r\n    action = {<font color=#FF00FF>\"1\"</font>:<font color=#FF00FF>\"dump\"</font>,<font color=#FF00FF>\"2\"</font>:<font color=#FF00FF>\"restore\"</font>}\r\n    actionKey = raw_input(<font color=#FF00FF>\"\"</font>)\r\n    act = action[actionKey.strip()]\r\n    <font color=#0000FF>print</font> <font color=#FF00FF>\'Please select section&#46;\'</font>\r\n    <font color=#0000FF>for</font> m <font color=#0000FF>in</font> range(len(config.sections())):\r\n        <font color=#0000FF>print</font> <font color=#FF00FF>\'&#37;s&#58;&#37;s\'</font> % (m+1, config.sections()[m])\r\n    sectionKey = raw_input(<font color=#FF00FF>\"\"</font>)\r\n    section = config.sections()[int(sectionKey)-1]\r\n    <font color=#0000FF>print</font> <font color=#FF00FF>\'You have selected &#37;s section&#46;\'</font> % section\r\n    dumpRestoreDB(section, act)\r\n</pre>\r\n</body>\r\n</html>\r\n<br><br>\r\n附上配置文件例子(dumpAndRestoreDB.ini)：<br>\r\n[prod-qmaster]<br>\r\ndbHost=127.0.0.1<br>\r\ndbUser=root<br>\r\ndbPass=123456<br>\r\ndbName=firstDB;secendDB<br>\r\n','python'),(7,'Python 发邮件带附件','','','','2015-04-01','佳华',0,'<html>\r\n<head>\r\n<title>SendmailBy.py</title>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=GBK\">\r\n<style type=\"text/css\">\r\n<!--.line_num {color: #666666; background-color: #E8E8E8;}//-->\r\n</style>\r\n</head>\r\n<body bgcolor=#FFFFFF text=#000000>\r\n<pre style=\"font: 9pt Verdana, Fixedsys, Verdana, Tahoma;\">\r\n<span class=line_num>        =====文件名：SendmailBy.py=====</span>\r\n\r\n<font color=#0000FF>import</font> smtplib\r\n<font color=#0000FF>from</font> email.mime.text <font color=#0000FF>import</font> MIMEText\r\n<font color=#0000FF>from</font> email.mime.multipart <font color=#0000FF>import</font> MIMEMultipart\r\n<font color=#0000FF>from</font> email.mime.base <font color=#0000FF>import</font> MIMEBase\r\n<font color=#0000FF>from</font> email.utils <font color=#0000FF>import</font> formatdate\r\n<font color=#0000FF>from</font> email <font color=#0000FF>import</font> encoders\r\n<font color=#0000FF>from</font> email.header <font color=#0000FF>import</font> Header\r\n\r\n<font color=#0000FF>def</font> sendmail(to_list,host,me,subject,files,content):\r\n     <font color=#0000FF>try</font>:\r\n          msg = MIMEMultipart()\r\n          h = Header(<font color=#FF00FF>\'Goldpay\'</font>)\r\n          h.append(<font color=#FF00FF>\'&#60;\'</font>+me+<font color=#FF00FF>\'&#62;\'</font>)\r\n          msg[<font color=#FF00FF>\'From\'</font>] = h\r\n          msg[<font color=#FF00FF>\'To\'</font>] = to_list\r\n          msg[<font color=#FF00FF>\'Subject\'</font>] = subject\r\n          msg[<font color=#FF00FF>\'Date\'</font>] = formatdate(localtime=True)\r\n          msg.attach(MIMEText(content,<font color=#FF00FF>\'html\'</font>,<font color=#FF00FF>\'utf8\'</font>))\r\n          part = MIMEBase(<font color=#FF00FF>\'application\'</font>, <font color=#FF00FF>\'octet&#45;stream\'</font>)\r\n          part.set_payload(open(files, <font color=#FF00FF>\'rb\'</font>).read())\r\n          encoders.encode_base64(part)\r\n          part.add_header(<font color=#FF00FF>\'Content&#45;Disposition\'</font>, <font color=#FF00FF>\'attachment&#59; filename&#61;&#34;&#37;s&#34;\'</font> % os.path.basename(f\r\niles))\r\n          msg.attach(part)\r\n          mail_list = to_list.split(<font color=#FF00FF>\'&#59;\'</font>)\r\n          smtp = smtplib.SMTP(host)\r\n          smtp.set_debuglevel(1)\r\n          smtp.sendmail(me,mail_list,msg.as_string())\r\n          smtp.quit()\r\n          <font color=#0000FF>print</font> <font color=#FF00FF>\'email send success&#46;\'</font>\r\n     <font color=#0000FF>except</font> Exception ,e:  \r\n          <font color=#0000FF>print</font> e  \r\n          <font color=#0000FF>print</font> <font color=#FF00FF>\'email send failed&#46;\'</font>\r\n\r\n说明：参数 to_list 是分号间隔的邮址<br>\r\nhost：我方邮件主机ip<br>\r\nme：发件人<br>\r\nfiles: 附件路径<br>\r\ncontent是邮件内容<br>\r\n\r\n\r\n</pre>\r\n</body>\r\n</html>\r\n','python'),(8,'Python map用法例子','','','','2015-04-01','',0,' \'\\n\'.join([\'\'.join(map(str, i)) for i in trainset1])','python'),(9,'Pycha画图自定义','uploadImages/pycha_lh98djV.png','550','320','2015-04-01','佳华',0,'出报表要饼图、线图、各种图咋办，用pycha，默认画出来的图就很漂亮。<br>\r\n但是有个问题就是pycha默认画出来的图颜色是依次递减的不能自定义颜色。<br>\r\n分类多了画出来的图就很难分辨颜色了<br>\r\n这里是pycha自定义颜色的办法<br>\r\nvim /usr/local/lib/python2.7/dist-packages/pycha-0.6.0-py2.7.egg/pycha/color.py<br>\r\n第161行改成如图  <br>\r\n先找到想要的颜色RGB值，分别把 RGB 除以 255<br> \r\n\r\n再加一个我的样式例子，具体参考<a href=\"http://blog.csdn.net/dyx1024/article/details/7304263\" target=\"_blank\" >这里</a>,感谢原著socrates。<br>\r\n<html>\r\n<head>\r\n<title>conf.py</title>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=GBK\">\r\n<style type=\"text/css\">\r\n<!--.line_num {color: #666666; background-color: #E8E8E8;}//-->\r\n</style>\r\n</head>\r\n<body bgcolor=#FFFFFF text=#000000>\r\n<pre style=\"font: 9pt Verdana, Fixedsys, Verdana, Tahoma;\">\r\n<span class=line_num>        =====文件名：conf.py=====</span>\r\ndataSet=[\r\n          [<font color=#FF00FF>\'Last&#95;Week\'</font>,[[1,<font color=#FF00FF>\"%.2f%%\"</font> % 0.98*100],[2,<font color=#FF00FF>\"%.2f%%\"</font> % 0.5*100]]],\r\n          [<font color=#FF00FF>\'This&#95;Week\'</font>,[]]\r\n     ]\r\n\r\n options={  \r\n                 <font color=#FF00FF>\'axis\'</font>: { \r\n                      <font color=#FF00FF>\'x\'</font>: {                       #x轴 \r\n<font color=#008000>                          #\'label\': \'month\',        #标签名称 </font>\r\n<font color=#008000>                          #\'rotate\': 25,</font>\r\n                    <font color=#FF00FF>\'ticks\'</font>:[{<font color=#FF00FF>\'v\'</font>:1, <font color=#FF00FF>\'label\'</font>:<font color=#FF00FF>\'Mon\'</font>},{<font color=#FF00FF>\'v\'</font>:2, <font color=#FF00FF>\'label\'</font>:<font color=#FF00FF>\'THREE\'</font>}]    \r\n                      }, \r\n                      <font color=#FF00FF>\'y\'</font>: {                       #y轴 \r\n<font color=#008000>                     #     \'tickCount\': 8,          #横线个数 </font>\r\n                          <font color=#FF00FF>\'label\'</font>: <font color=#FF00FF>\'count\'</font> \r\n                      } \r\n             }, \r\n<font color=#008000>             #\'background\': { </font>\r\n<font color=#008000>                 #     \'chartColor\': \'#ffffff\',     #图表背景色 </font>\r\n<font color=#008000>                 #     \'baseColor\': \'#ffffff\',      #边框颜色 </font>\r\n<font color=#008000>                 #     \'lineColor\': \'#989898\'       #横线颜色 </font>\r\n<font color=#008000>             #}, </font>\r\n<font color=#008000>             #\'colorScheme\': { </font>\r\n<font color=#008000>                 #     \'name\': \'gradient\', </font>\r\n<font color=#008000>                 #     \'args\': { </font>\r\n<font color=#008000>                #          \'initialColor\': \'#030fab\', #图表颜色 </font>\r\n<font color=#008000>                 #     }, </font>\r\n<font color=#008000>             #}, </font>\r\n             <font color=#FF00FF>\'legend\'</font>: { \r\n                      <font color=#FF00FF>\'hide\'</font>: False,     #是否隐藏图标示例 \r\n             }, \r\n<font color=#008000>             #\'padding\': { </font>\r\n<font color=#008000>                 #     \'left\': 10,       #左边框 </font>\r\n<font color=#008000>                 #     \'bottom\': 10,     #底边框 </font>\r\n<font color=#008000>             #},</font>\r\n             <font color=#FF00FF>\'shouldFill\'</font>: False,\r\n             <font color=#FF00FF>\'title\'</font>: <font color=#FF00FF>\'pychar test\'</font> #图片标题 \r\n            }\r\n</pre>\r\n</body>\r\n</html>\r\n','python'),(10,'Django 小技巧','','','','2015-04-01','佳华',0,'<html>\r\n<head>\r\n<title>django.py</title>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=GBK\">\r\n<style type=\"text/css\">\r\n<!--.line_num {color: #666666; background-color: #E8E8E8;}//-->\r\n</style>\r\n</head>\r\n<body bgcolor=#FFFFFF text=#000000>\r\n<pre style=\"font: 9pt Verdana, Fixedsys, Verdana, Tahoma;\">\r\n<span class=line_num>        =====文件名：django.py=====</span>\r\n\r\nlocals()\r\n\r\n 它返回的字典对所有局部变量的名称与值进行映射。 因此，前面的视图可以重写成下面这个样子：\r\n\r\n<font color=#0000FF>def</font> current_datetime(request):\r\n    now = datetime.datetime.now()\r\n    <font color=#0000FF>return</font> render_to_response(<font color=#FF00FF>\'current&#95;datetime&#46;html\'</font>, {<font color=#FF00FF>\'current&#95;date\'</font>: now})\r\n\r\n<font color=#0000FF>def</font> current_datetime(request):\r\n    current_date = datetime.datetime.now()\r\n    <font color=#0000FF>return</font> render_to_response(<font color=#FF00FF>\'current&#95;datetime&#46;html\'</font>, locals())\r\n</pre>\r\n</body>\r\n</html>\r\n','django'),(11,'链接带参数','','','','2015-04-01','佳华',0,'<html>\r\n<head>\r\n<title>django.py</title>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=GBK\">\r\n<style type=\"text/css\">\r\n<!--.line_num {color: #666666; background-color: #E8E8E8;}//-->\r\n</style>\r\n</head>\r\n<body bgcolor=#FFFFFF text=#000000>\r\n<pre style=\"font: 9pt Verdana, Fixedsys, Verdana, Tahoma;\">\r\n<span class=line_num>        =====文件名：django.py=====</span>\r\n<font color=#008000>#urls.py</font>\r\n(r<font color=#FF00FF>\'&#94;hello&#47;&#40;&#92;d&#123;1&#125;&#41;&#47;&#40;&#92;d&#43;&#41;&#47;&#36;\'</font>,pattan)   带括号，第一个表示第一个参数，第二个表示第二个参数\r\n<font color=#008000>#view.py</font>\r\n<font color=#0000FF>def</font> pattan(request,frist,second):\r\n     <font color=#0000FF>return</font> HttpResponse(frist + second)\r\n</pre>\r\n</body>\r\n</html>\r\n','django'),(12,'django模型','','','','2015-04-01','佳华',0,'查看模型是否有错误 model<br>\r\n#python manage.py validate<br>\r\n<br>\r\n<br>\r\n将model定义好的生成建表语句<br>\r\n#python manage.py sqlall blog（app名字）<br>\r\n','django'),(13,'django模板语言','','','','2015-04-01','Jerry',0,'模板关闭转义，直接读HTML内容<br>\r\n{% autoescape off %}<br>\r\n   {{msg.content}}<br>\r\n{% endautoescape %}<br>\r\n','django'),(14,'获取数据库最后一个id的对象的id','','','','2015-04-01','佳华',0,'Image.objects.all().order_by(\"-id\")[0]<br>\r\n或者<br>\r\nImage.objects.latest(\'id\').id<br>\r\n','django'),(15,'admin管理界面自动中文','','','','2015-04-01','佳华',0,'在MIDDLEWARE_CLASSES添加\'django.middleware.locale.LocaleMiddleware\',','django'),(16,'admin管理界面允许空值','','','','2015-04-01','佳华',0,'pic1 = models.ImageField(\'图片\',upload_to=\'uploadImages\',blank=True,null=True)','django'),(17,'django 提交post请求','','','','2015-04-01','佳华',0,'方法上面加一个 @csrf_exempt','django'),(18,'Django上传文件','','','','2015-04-01','佳华',0,'<html>\r\n<head>\r\n<title>django.py</title>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=GBK\">\r\n<style type=\"text/css\">\r\n<!--.line_num {color: #666666; background-color: #E8E8E8;}//-->\r\n</style>\r\n</head>\r\n<body bgcolor=#FFFFFF text=#000000>\r\n<pre style=\"font: 9pt Verdana, Fixedsys, Verdana, Tahoma;\">\r\n<span class=line_num>        =====文件名：django.py=====</span>\r\n两种方法：\r\n\r\n第一种：调用对象的chunks方法写入文件\r\n\r\n<font color=#008000>#views.py</font>\r\n<font color=#0000FF>def</font> upfile(request):\r\n     <font color=#0000FF>if</font> request.method == <font color=#FF00FF>\'POST\'</font>:\r\n          file_obj = request.FILES.get(<font color=#FF00FF>\'fileup\'</font>, None)\r\n          f = open(<font color=#FF00FF>\'test&#46;jpg\'</font>,<font color=#FF00FF>\'wb&#43;\'</font>)\r\n          <font color=#0000FF>for</font> chk <font color=#0000FF>in</font> file_obj.chunks():\r\n               f.write(chk)\r\n          f.close()\r\n     <font color=#0000FF>return</font> HttpResponse(<font color=#FF00FF>\'upload ok\'</font>)\r\n\r\n\r\n第二种：使用django自带的包\r\n<font color=#008000>#views.py</font>\r\n<font color=#0000FF>from</font> django.shortcuts <font color=#0000FF>import</font> render_to_response\r\n<font color=#0000FF>from</font> django.http <font color=#0000FF>import</font> HttpResponse\r\n<font color=#0000FF>from</font> django.core.files.storage <font color=#0000FF>import</font> default_storage\r\n<font color=#0000FF>from</font> django.core.files.base <font color=#0000FF>import</font> ContentFile\r\n\r\n<font color=#0000FF>def</font> upfile(request):\r\n     <font color=#0000FF>if</font> request.method == <font color=#FF00FF>\'POST\'</font>:\r\n          file_obj = request.FILES.get(<font color=#FF00FF>\'fileup\'</font>, None)\r\n          path = default_storage.save(<font color=#FF00FF>\'file&#46;jpg\'</font>, ContentFile(file_obj.read()))\r\n     <font color=#0000FF>return</font> HttpResponse(<font color=#FF00FF>\'upload ok\'</font>)\r\n</pre>\r\n</body>\r\n</html>\r\n','django'),(19,'Mysql 查2个表里有关联关系的','','','','2015-04-01','佳华',0,'select goldq_user.username, goldq_account.account_num from goldq_user, goldq_account where goldq_user.id>56 and goldq_user.id=goldq_account.user_id','others'),(20,'Mysql查字段有重复的','','','','2015-04-01','佳华',0,'SELECT TRIM(REPLACE(REPLACE(username, \'\\r\', \'\'), \'\\n\', \'\')),COUNT(*) AS COUNT  FROM goldq_user GROUP BY TRIM(REPLACE(REPLACE(username, \'\\r\', \'\'), \'\\n\', \'\')) HAVING COUNT(*)>1','others'),(21,'Mysql去掉字段那一列所有换行','','','','2015-04-01','佳华',0,'UPDATE test SET log = REPLACE(REPLACE(log, \'\\r\', \'\'), \'\\n\', \'\');','others'),(22,'Mysql权限和密码','','','','2015-04-01','佳华',0,'set password for root@localhost=password(\'root\');<br>\r\n<br>\r\nGRANT ALL PRIVILEGES ON *.* TO\'root\'@\'192.168.10.121\'IDENTIFIED BY \'root\' WITH GRANT OPTION;  让192.168.10.105有登录的权限<br>\r\n<br>\r\n设置访问全部数据库权限<br>\r\n\r\n<br>\r\nmysql>grant all privileges on *.* to \'root\'@\'%\';<br>\r\n\r\n不行就执行下面这个<br>\r\ngrant all on *.* to root@\"%\" identified by \"adm123\";<br>\r\nflush privileges;<br>','others'),(23,'HTML播放视频','','','','2015-04-01','佳华',0,'&lt;object classid=&quot;clsid:D27CDB6E-AE6D-11cf-96B8-444553540000&quot; codebase=&quot;http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0&quot; width=&quot;490&quot; height=&quot;390&quot;&gt;<br>\r\n\r\n&lt;param name=&quot;movie&quot; value=&quot;Flvplayer.swf&quot;&gt;<br>\r\n\r\n&lt;param name=&quot;quality&quot; value=&quot;high&quot;&gt;<br>\r\n\r\n&lt;param name=&quot;allowFullScreen&quot; value=&quot;true&quot; /&gt;<br>\r\n\r\n&lt;param name=&quot;FlashVars&quot; value=&quot;vcastr_file=hewen.flv&quot; /&gt;<br>\r\n\r\n&lt;embed src=&quot;Flvplayer.swf&quot; allowFullScreen=&quot;true&quot; <br>FlashVars=&quot;vcastr_file=hewen.flv&quot; quality=&quot;high&quot; <br>pluginspage=&quot;http://www.macromedia.com/go/getflashplayer&quot; type=&quot;application/x-<br>shockwave-flash&quot; width=&quot;490&quot; height=&quot;390&quot;&gt;&lt;/embed&gt;<br>\r\n\r\n&lt;/object&gt;<br><br>\r\n\r\n\r\n\r\n\r\n要去下载个 Flvplayer.swf（请百度罗）\r\n','others'),(24,'AWS获取某一个监控数据','','','','2015-04-01','佳华',0,'data = \'/usr/local/bin/aws --profile \'+profile+ \' cloudwatch get-metric-statistics --metric-name \'+metric+\' --start-time \'+start_time+\' --end-time \'+end_time+\' --period 60 --namespace \'+namespace+\' --statistics \'+statistics+\' --dimensions Name=\'+Name+\',Value=\'+Value+\'|tail -1|awk -F \\\' \\\' \\\'{print $2}\\\'\'<br>\r\n以上不带引号的是变量，填入具体的值即可','aws'),(25,'AWS命令行恢复AMI','','','','2015-04-01','佳华',0,'aws ec2 run-instances --image-id ami-e5928fc2 --count 1 --instance-type t1.micro --key-name Public-key --security-group-ids sg-b1e20ede --subnet-id subnet-90312bf8 --associate-public-ip-address --output json','aws'),(26,'Unity3D数学','','','','2015-04-01','佳华',0,'1、 写完了才发现 原来没必要这么麻烦,这样transform.forward=(mousePos-<br>transform.position).normalized就可以直接让角色朝向目标点<br>\r\n<br>\r\n2、向量点乘和叉乘<br>\r\nVector3 tempDir=Vector3.Cross(transform.forward,targetDir.normalized);//用叉乘判断两个向量 是否同方向<br>\r\nfloat dotValue=Vector3.Dot(transform.forward,targetDir.normalized);//点乘 计算两个向量的夹角，及角色和目标点的夹角<br>\r\n','others'),(27,'Unity3D Web设置全屏','','','','2015-04-01','佳华',0,'<html>\r\n<head>\r\n<title>u3d.py</title>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=GBK\">\r\n<style type=\"text/css\">\r\n<!--.line_num {color: #666666; background-color: #E8E8E8;}//-->\r\n</style>\r\n</head>\r\n<body bgcolor=#FFFFFF text=#000000>\r\n<pre style=\"font: 9pt Verdana, Fixedsys, Verdana, Tahoma;\">\r\n<span class=line_num>        =====文件名：u3d.py=====</span>\r\n\r\n    * Open “WebPlayer.html” to some text editor, <font color=#0000FF>for</font> example default windows Notepad <font color=#0000FF>or</font> notepad++\r\n    * You are now viewing the HTML source, find lines:\r\nvar config = {\r\nwidth: 960,\r\nheight: 600,\r\n    * Replace those numbers with:\r\nvar config = {\r\nwidth: window.innerWidth,\r\nheight: window.innerHeight,\r\n    * Go down a bit, find lines:\r\nbody {\r\nfont-family: Helvetica, Verdana, Arial, sans-serif;\r\nbackground-color: white;\r\ncolor: black;\r\ntext-align: center;\r\n}\r\n    * After line “text-align: center;”, add these lines:\r\nmargin:0px;\r\npadding:0px;\r\nwidth:100%;\r\nheight:100%;\r\n    * Next find line:\r\ndiv.content {\r\nmargin: auto;\r\nwidth: 960px;\r\n}\r\n    * Modify that style to:\r\ndiv.content {\r\nmargin: auto;\r\nwidth: 100%;\r\nheight:100%;\r\n}\r\n    * Find this part:\r\ndiv#unityPlayer {\r\ncursor: default;\r\nheight: 600px;\r\nwidth: 960px;\r\n}\r\n    * Modify it to:\r\ndiv#unityPlayer {\r\ncursor: default;\r\nheight: 100%;\r\nwidth: 100%;\r\n}\r\n    * *NEW: Insert this style also, to override embed object width:\r\nembed\r\n{\r\nwidth:100% !important;\r\n}\r\n    * Next we just remove the extra elements <font color=#0000FF>from</font> the page, so that only the player <font color=#0000FF>is</font> left\r\n    * Find this line, <font color=#0000FF>and</font> delete it:\r\n&lt;p&gt;&lt;span&gt;Unity Web Player | &lt;/span&gt;v4d&lt;/p&gt;\r\n    * Same here, remove this line:\r\n&lt;p&gt;&laquo; created with &lt;a href=”http://unity3d.com/unity/” title=”Go to unity3d.com”&gt;Unity&lt;/a&gt; &raquo;&lt;/p&gt;\r\n    * Save the html file <font color=#0000FF>and</font> test it!\r\n\r\n</pre>\r\n</body>\r\n</html>\r\n','others'),(28,'Unity3D人物控制','','','','2015-04-01','佳华',0,'<html>\r\n<head>\r\n<title>u3d.py</title>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=GBK\">\r\n<style type=\"text/css\">\r\n<!--.line_num {color: #666666; background-color: #E8E8E8;}//-->\r\n</style>\r\n</head>\r\n<body bgcolor=#FFFFFF text=#000000>\r\n<pre style=\"font: 9pt Verdana, Fixedsys, Verdana, Tahoma;\">\r\n<span class=line_num>        =====文件名：u3d.py=====</span>\r\nusing UnityEngine;\r\nusing System.Collections;\r\n\r\npublic <font color=#0000FF>class</font> Move : MonoBehaviour {\r\n\r\n    public const string ANIM_NAME2 = <font color=#FF00FF>\"walk\"</font>;\r\n     private float moveSpeed=10.0f;\r\n     private float rotateSpeed=3.0f;\r\n\r\n    private GameObject obj = null;\r\n    // Use this <font color=#0000FF>for</font> initialization\r\n    void Start()\r\n    {\r\n        obj = GameObject.Find(<font color=#FF00FF>\"girl@walk\"</font>);\r\n        //obj.animation.wrapMode = WrapMode.Loop;\r\n    }\r\n\r\n    // Update <font color=#0000FF>is</font> called once per frame\r\n    void Update()\r\n    {\r\n        <font color=#0000FF>if</font> (Input.GetKey(KeyCode.W))\r\n        {\r\n            obj.animation.Play(ANIM_NAME2);\r\n               obj.transform.Translate(Vector3.forward*Time.deltaTime*moveSpeed);\r\n               Debug.Log(<font color=#FF00FF>\"W Have down\"</font>);\r\n        }\r\n          <font color=#0000FF>if</font>(Input.GetKey(KeyCode.S))\r\n          {\r\n               obj.animation.Play(ANIM_NAME2);\r\n               obj.transform.Translate(Vector3.forward*Time.deltaTime*-moveSpeed);\r\n               Debug.Log (<font color=#FF00FF>\"S Have Down\"</font>);\r\n          }\r\n          <font color=#0000FF>if</font>(Input.GetKey(KeyCode.A))\r\n          {\r\n               obj.animation.Play(ANIM_NAME2);\r\n               obj.transform.Rotate(0,90,0);\r\n               obj.transform.Translate(Vector3.right*Time.deltaTime*-rotateSpeed);\r\n               Debug.Log (<font color=#FF00FF>\"A Have Down\"</font>);\r\n          }\r\n          <font color=#0000FF>if</font>(Input.GetKey(KeyCode.D))\r\n          {\r\n               obj.animation.Play(ANIM_NAME2);\r\n               obj.transform.Translate(Vector3.right*Time.deltaTime*rotateSpeed);\r\n               Debug.Log(<font color=#FF00FF>\"D Have Down\"</font>);\r\n          }\r\n    }\r\n\r\n     void OnGUI()\r\n     {\r\n     GUILayout.Label(<font color=#FF00FF>\"点击字母w播放动画\"</font>);\r\n     }\r\n}\r\n</pre>\r\n</body>\r\n</html>\r\n','others'),(29,'Linux不常用但重要之命令（一）','','','','2015-04-01','佳华',0,'<html>\r\n<head>\r\n<title>linux.py</title>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=GBK\">\r\n<style type=\"text/css\">\r\n<!--.line_num {color: #666666; background-color: #E8E8E8;}//-->\r\n</style>\r\n</head>\r\n<body bgcolor=#FFFFFF text=#000000>\r\n<pre style=\"font: 9pt Verdana, Fixedsys, Verdana, Tahoma;\">\r\n<span class=line_num>        =====文件名：linux.py=====</span>\r\n硬盘测读写：\r\n读：# hdparm -t /dev/sda1\r\n写：# dd <font color=#0000FF>if</font>=/dev/zero of=/test count=1000 bs=1M\r\n\r\n查看编码：\r\n<font color=#008000># locale -a</font>\r\n\r\n同步时间：\r\n<font color=#008000>#/usr/sbin/ntpdate -s time.nist.gov</font>\r\n\r\nMount光盘或是U盘：\r\n<font color=#008000>#mkdir -p /mnt/cdrom or (mkdir -p /mnt/usb)</font>\r\n<font color=#008000>#mount /dev/cdrom /mnt/cdrom or (mount -t vfat /dev/sda1 /mnt/usb)</font>\r\n<font color=#008000>#cd /mnt/cdrom or cd /mnt/usb</font>\r\n\r\n清理Linux DNS缓存：\r\n<font color=#008000>#/etc/init.d/nscd restart</font>\r\n\r\n大小写转换：\r\n<font color=#008000>#sed?\'s/[A-Z]/\\l&/g\'?filename</font>\r\n\r\nstrace命令：\r\nstrace 命令是一种强大的工具，它能够显示所有由用户空间程序发出的系统调用。\r\n<font color=#008000>#strace -o ls.truss ls -al： 跟踪ls -al的运行，将输出信息写到文件/tmp/ls.truss中。</font>\r\n<font color=#008000>#strace -f -o vim.strace vim： 跟踪vim及其子进程的运行，将输出信息写到文件vim.strace。</font>\r\n<font color=#008000>#strace -p 234： 跟踪一个pid为234的已经在运行的进程。</font>\r\n\r\nlsof命令：\r\nlsof -i:端口  显示占用该端口的进程情况 \r\n\r\nlinux中怎么查找权限位为S的文件：\r\n<font color=#008000>#find / -type f \\(-perm -04000 -o -perm -02000\\) -exec ls -lg {} \\;</font>\r\n\r\n\r\nxargs命令:\r\nls | xargs -t -i mv {} {}.bak 当前目录下所有文件更名为xxx.bak\r\n</pre>\r\n</body>\r\n</html>\r\n','linux'),(30,'Python 八皇后','','','','2015-04-16','Jerry',0,'<html>\r\n<head>\r\n<title>1.py</title>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=GBK\">\r\n<style type=\"text/css\">\r\n<!--.line_num {color: #666666; background-color: #E8E8E8;}//-->\r\n</style>\r\n</head>\r\n<body bgcolor=#FFFFFF text=#000000>\r\n<pre style=\"font: 9pt Verdana, Fixedsys, Verdana, Tahoma;\">\r\n<span class=line_num>        =====文件名：1.py=====</span>\r\n<font color=#0000FF>from</font> sys <font color=#0000FF>import</font> argv\r\n<font color=#0000FF>import</font> random\r\n\r\n<font color=#008000>#--------------------------------------------</font>\r\n<font color=#0000FF>def</font> isConflict(state , nextX) :\r\n<font color=#008000>  \"\"\"</font>\r\n  isConflict - check <font color=#0000FF>if</font> the nextX conflict to the state\r\n  state - the right pisition of the queens which have been places\r\n  nextX - the next queen\'s x position\r\n  <font color=#0000FF>return</font> value - True = conflict\r\n<font color=#008000>  \"\"\"</font>\r\n  nextY = len(state)\r\n  <font color=#0000FF>for</font> n <font color=#0000FF>in</font> range(len(state)) :\r\n    <font color=#0000FF>if</font> abs(state[n] - nextX) <font color=#0000FF>in</font> (0 , nextY - n) :\r\n      <font color=#0000FF>return</font> True\r\n  <font color=#0000FF>return</font> False\r\n\r\n<font color=#008000>#---------------------------------------------</font>\r\n<font color=#0000FF>def</font> queens(num = 8 , state = ()) :\r\n<font color=#008000>  #base case</font>\r\n  <font color=#0000FF>print</font>  <font color=#FF00FF>\"state:\"</font>,state\r\n  <font color=#0000FF>if</font> len(state) == num - 1 :\r\n    <font color=#0000FF>for</font> pos <font color=#0000FF>in</font> range(num) :\r\n      <font color=#0000FF>if</font> <font color=#0000FF>not</font> isConflict(state , pos) :\r\n        yield (pos,)\r\n  <font color=#0000FF>else</font> :\r\n    <font color=#0000FF>for</font> pos <font color=#0000FF>in</font> range(num) :\r\n      <font color=#0000FF>if</font> <font color=#0000FF>not</font> isConflict(state , pos) :\r\n        <font color=#0000FF>for</font> result <font color=#0000FF>in</font> queens(num , state+(pos,)) :\r\n          yield (pos,) + result\r\n\r\n<font color=#008000>#-------------------------------------------</font>\r\n<font color=#0000FF>def</font> printQueens(state):\r\n<font color=#008000>  \"\"\"</font>\r\n  printQueens - <font color=#0000FF>print</font> the state\r\n<font color=#008000>  \"\"\"</font>\r\n  <font color=#0000FF>def</font> line(pos , length = len(state)) :\r\n    <font color=#0000FF>print</font> <font color=#FF00FF>\' &#46; \'</font>*pos+<font color=#FF00FF>\' X \'</font>+<font color=#FF00FF>\' &#46; \'</font>*(length-pos-1)\r\n\r\n  <font color=#0000FF>for</font> pos <font color=#0000FF>in</font> state:\r\n    line(pos)\r\n\r\n<font color=#008000>#===========================================</font>\r\n<font color=#0000FF>if</font> __name__ == <font color=#FF00FF>\'&#95;&#95;main&#95;&#95;\'</font> :\r\n  <font color=#0000FF>if</font> len(argv) != 2 :\r\n    <font color=#0000FF>print</font> <font color=#FF00FF>\"Usage : queens [number]\"</font>\r\n    exit(-1)\r\n\r\n  results = list(queens(int(argv[1])))\r\n  <font color=#0000FF>for</font> result <font color=#0000FF>in</font> results :\r\n    <font color=#0000FF>print</font> result\r\n\r\n<font color=#008000>  #print a result by random</font>\r\n  theOne = random.choice(results)\r\n  printQueens(theOne)\r\n</pre>\r\n</body>\r\n</html>\r\n','python'),(32,'Django+Celery+Rabbitmq实现异步调用','uploadImages/celery.png','','','2016-04-29','佳华',520,'\r\n<html>\r\n<head>\r\n<title>1.py</title>\r\n<meta http-equiv=\"content-type\" content=\"text/html; charset=GBK\">\r\n<style type=\"text/css\">\r\n<!--.line_num {color: #666666; background-color: #E8E8E8;}//-->\r\n</style>\r\n</head>\r\n<body bgcolor=#FFFFFF text=#000000>\r\n<pre style=\"font: 9pt Verdana, Fixedsys, Verdana, Tahoma;\">\r\n<span class=line_num></span>\r\n共三台Server：A,B,C\r\nA: 消息发起\r\nB：RabbitMQ Server\r\nC：消息接受，执行异步任务\r\n\r\n1、安装步骤\r\nA机器安装 django、django-celery、flower(消息监控页面)\r\nB机器安装 rabbitmq\r\nC机器安装 django、django-celery\r\n\r\n安装命令：\r\ndjango\r\n$pip install -U <font color=#FF00FF>\'django&#61;&#61;1&#46;8&#46;5\'</font>\r\n\r\ncelery\r\n$pip install django-celery\r\n\r\nflower\r\n$pip install flower\r\n\r\nrabbitmq\r\n$yum install rabbitmq\r\n\r\n2、配置步骤\r\nA机器django配置：\r\n修改settings.py\r\n\r\n在INSTALLED_APPS中加入app：\r\n\r\nINSTALLED_APPS = (\r\n  ...\r\n  <font color=#FF00FF>\'djcelery\'</font>,      \r\n  <font color=#FF00FF>\'blog\'</font>,             # startapp\r\n}\r\n\r\n添加RabbitMQ的配置：\r\n<font color=#0000FF>import</font> djcelery\r\ndjcelery.setup_loader()\r\n\r\nBROKER_HOST = <font color=#FF00FF>\"localhost\"</font>\r\nBROKER_PORT = 5672\r\nBROKER_USER = <font color=#FF00FF>\"jiahua\"</font>\r\nBROKER_PASSWORD = <font color=#FF00FF>\"jiahua\"</font>\r\nBROKER_VHOST = <font color=#FF00FF>\"/\"</font>\r\n\r\n在 blog/ 下新建 tasks.py \r\n<font color=#008000># task.py</font>\r\n<font color=#0000FF>from</font> celery <font color=#0000FF>import</font> task\r\n<font color=#0000FF>import</font> time\r\n\r\n@task(queue=<font color=#FF00FF>\"test\"</font>) # 指定目标 queue\r\n<font color=#0000FF>def</font> add():\r\n    <font color=#0000FF>print</font> <font color=#FF00FF>\"send message\"</font>\r\n    <font color=#0000FF>return</font> True\r\n\r\n在 blog/views.py 加入\r\n<font color=#0000FF>from</font> django.shortcuts <font color=#0000FF>import</font> render\r\n<font color=#0000FF>from</font> django.http <font color=#0000FF>import</font> HttpResponse,HttpResponseRedirect\r\n<font color=#008000># Create your views here.</font>\r\n<font color=#0000FF>from</font> tasks <font color=#0000FF>import</font> add\r\n\r\n<font color=#0000FF>def</font> index(req):\r\n    r = add.delay() # 发起消息，可带参数给 B 机器\r\n    <font color=#0000FF>return</font> HttpResponse(<font color=#FF00FF>\"hello\"</font>)\r\n\r\nA机器启动flower\r\n$python manage.py celery flower --broker_api=http://jiahua:jiahua@localhost:15672/api/ --basic_auth=jerry:jerry\r\n\r\n======================================================\r\n\r\nB机器启动rabbitmq\r\n$service rabbitmq-server start\r\n\r\n======================================================\r\n\r\nC机器Django配置\r\ndjango配置见上面A机器配置\r\n不同的是 blog/tasks.py 内容\r\n<font color=#0000FF>from</font> celery <font color=#0000FF>import</font> task\r\n<font color=#0000FF>import</font> time\r\n\r\n@task(queue=<font color=#FF00FF>\"test\"</font>)\r\n<font color=#0000FF>def</font> add():\r\n    time.sleep(20) # 这里就是真正要异步执行的任务，可加入 <font color=#0000FF>try</font> 写 LOG 等等\r\n    <font color=#0000FF>return</font> 1\r\n\r\nC机器启动 celery worker\r\n$python manage.py celery worker --loglevel=debug --concurrency=20 -Q test # 20个worker，指定 test 这个queue\r\n\r\n\r\n3、测试\r\n页面访问 http://A/blog/index/  # 开始发送消息啦\r\n打开 flower 查看队列 http://A:5555 \r\nOK! 测试完成， celery、flower都可以用 supervisor 跑起来\r\n\r\nsupervisor部分\r\n1、安装\r\n<font color=#008000>#easy_install supervisor</font>\r\n2、配置\r\n<font color=#008000>#echo_supervisord_conf &gt; /etc/supervisord.conf</font>\r\n在 /etc/supervisord.conf 下面加入如下 celery 配置\r\n[program:celery]\r\ncommand=/usr/bin/python /usr/local/cdn/manage.py celery worker --loglevel=info -f /usr/local/cdn/logs/celery.log\r\n\r\nuser=root\r\nnumprocs=1\r\nstdout_logfile=/usr/local/cdn/logs/worker.log\r\nstderr_logfile=/usr/local/cdn/logs/worker.log\r\nautostart=true\r\nautorestart=true\r\nstartsecs=10\r\nstopwaitsecs=600\r\nkillasgroup=true\r\n\r\n3、启动 \r\n<font color=#008000>#supervisord</font>\r\n\r\n\r\n\r\n\r\n参考资料：\r\nflower配置：http://flower.readthedocs.io/en/latest/config.html#broker-api\r\ncelery配置：http://docs.celeryproject.org/en/latest/configuration.html\r\n</pre>\r\n</body>\r\n</html>\r\n','django');
